import React from 'react';
import { Link } from 'react-router-dom';


export class Home extends React.Component {
    render() {
        return (
            <div>
                <button>
                    TicTacToe
                    <Link to='/TicTacToe'></Link>
                </button>
                <button>
                    GoodsShow
                    <Link to='/GoodsShow'></Link>
                </button>
            </div>
        );
    }
}
